    @test_int [(a + b*sec(c + d*x^2))/x^2, x, 2, -(a/x) + b*Unintegrable(sec(c + d*x^2)/x^2, x)]


    @test_int [x^5/(a + b*sec(c + d*x^2))^2, x, 31, ((-im/2)*b^2*x^4)/(a^2*(a^2 - b^2)*d) + x^6/(6*a^2) + (b^2*x^2*log(1 + (a*ℯ^(im*(c + d*x^2)))/(b - im*sqrt(a^2 - b^2))))/(a^2*(a^2 - b^2)*d^2) + (b^2*x^2*log(1 + (a*ℯ^(im*(c + d*x^2)))/(b + im*sqrt(a^2 - b^2))))/(a^2*(a^2 - b^2)*d^2) - ((im/2)*b^3*x^4*log(1 + (a*ℯ^(im*(c + d*x^2)))/(b - sqrt(-a^2 + b^2))))/(a^2*(-a^2 + b^2)^(3/2)*d) + (im*b*x^4*log(1 + (a*ℯ^(im*(c + d*x^2)))/(b - sqrt(-a^2 + b^2))))/(a^2*sqrt(-a^2 + b^2)*d) + ((im/2)*b^3*x^4*log(1 + (a*ℯ^(im*(c + d*x^2)))/(b + sqrt(-a^2 + b^2))))/(a^2*(-a^2 + b^2)^(3/2)*d) - (im*b*x^4*log(1 + (a*ℯ^(im*(c + d*x^2)))/(b + sqrt(-a^2 + b^2))))/(a^2*sqrt(-a^2 + b^2)*d) - (im*b^2*PolyLog(2, -((a*ℯ^(im*(c + d*x^2)))/(b - im*sqrt(a^2 - b^2)))))/(a^2*(a^2 - b^2)*d^3) - (im*b^2*PolyLog(2, -((a*ℯ^(im*(c + d*x^2)))/(b + im*sqrt(a^2 - b^2)))))/(a^2*(a^2 - b^2)*d^3) - (b^3*x^2*PolyLog(2, -((a*ℯ^(im*(c + d*x^2)))/(b - sqrt(-a^2 + b^2)))))/(a^2*(-a^2 + b^2)^(3/2)*d^2) + (2*b*x^2*PolyLog(2, -((a*ℯ^(im*(c + d*x^2)))/(b - sqrt(-a^2 + b^2)))))/(a^2*sqrt(-a^2 + b^2)*d^2) + (b^3*x^2*PolyLog(2, -((a*ℯ^(im*(c + d*x^2)))/(b + sqrt(-a^2 + b^2)))))/(a^2*(-a^2 + b^2)^(3/2)*d^2) - (2*b*x^2*PolyLog(2, -((a*ℯ^(im*(c + d*x^2)))/(b + sqrt(-a^2 + b^2)))))/(a^2*sqrt(-a^2 + b^2)*d^2) - (im*b^3*PolyLog(3, -((a*ℯ^(im*(c + d*x^2)))/(b - sqrt(-a^2 + b^2)))))/(a^2*(-a^2 + b^2)^(3/2)*d^3) + ((2*im)*b*PolyLog(3, -((a*ℯ^(im*(c + d*x^2)))/(b - sqrt(-a^2 + b^2)))))/(a^2*sqrt(-a^2 + b^2)*d^3) + (im*b^3*PolyLog(3, -((a*ℯ^(im*(c + d*x^2)))/(b + sqrt(-a^2 + b^2)))))/(a^2*(-a^2 + b^2)^(3/2)*d^3) - ((2*im)*b*PolyLog(3, -((a*ℯ^(im*(c + d*x^2)))/(b + sqrt(-a^2 + b^2)))))/(a^2*sqrt(-a^2 + b^2)*d^3) + (b^2*x^4*sin(c + d*x^2))/(2*a*(a^2 - b^2)*d*(b + a*cos(c + d*x^2)))]
