    @test_int [x^3/(a + b*sec(c + d*x^2))^2, x, 22, x^4/(4*a^2) - ((im/2)*b^3*x^2*log(1 + (a*ℯ^(im*(c + d*x^2)))/(b - sqrt(-a^2 + b^2))))/(a^2*(-a^2 + b^2)^(3/2)*d) + (im*b*x^2*log(1 + (a*ℯ^(im*(c + d*x^2)))/(b - sqrt(-a^2 + b^2))))/(a^2*sqrt(-a^2 + b^2)*d) + ((im/2)*b^3*x^2*log(1 + (a*ℯ^(im*(c + d*x^2)))/(b + sqrt(-a^2 + b^2))))/(a^2*(-a^2 + b^2)^(3/2)*d) - (im*b*x^2*log(1 + (a*ℯ^(im*(c + d*x^2)))/(b + sqrt(-a^2 + b^2))))/(a^2*sqrt(-a^2 + b^2)*d) + (b^2*log(b + a*cos(c + d*x^2)))/(2*a^2*(a^2 - b^2)*d^2) - (b^3*PolyLog(2, -((a*ℯ^(im*(c + d*x^2)))/(b - sqrt(-a^2 + b^2)))))/(2*a^2*(-a^2 + b^2)^(3/2)*d^2) + (b*PolyLog(2, -((a*ℯ^(im*(c + d*x^2)))/(b - sqrt(-a^2 + b^2)))))/(a^2*sqrt(-a^2 + b^2)*d^2) + (b^3*PolyLog(2, -((a*ℯ^(im*(c + d*x^2)))/(b + sqrt(-a^2 + b^2)))))/(2*a^2*(-a^2 + b^2)^(3/2)*d^2) - (b*PolyLog(2, -((a*ℯ^(im*(c + d*x^2)))/(b + sqrt(-a^2 + b^2)))))/(a^2*sqrt(-a^2 + b^2)*d^2) + (b^2*x^2*sin(c + d*x^2))/(2*a*(a^2 - b^2)*d*(b + a*cos(c + d*x^2)))]
